import React from 'react';
import './Rating.css';


class Rating extends React.Component {
  render() {
    return (
      <form>
        <div className="rating-section">
          <input id="email" placeholder="E-mail" />
          <h1 className="text-center" alt="Simple">Simple Pure CSS Star Rating Widget Bootstrap 4</h1>
          <div className="container">
            <div classNa="starrating risingstar d-flex justify-content-center flex-row-reverse">
              <input type="radio" id="star5" name="rating" value="5" /><label for="star5" title="5 star">5</label>
              <input type="radio" id="star4" name="rating" value="4" /><label for="star4" title="4 star">4</label>
              <input type="radio" id="star3" name="rating" value="3" /><label for="star3" title="3 star">3</label>
              <input type="radio" id="star2" name="rating" value="2" /><label for="star2" title="2 star">2</label>
              <input type="radio" id="star1" name="rating" value="1" /><label for="star1" title="1 star">1</label>
            </div>
          </div>
        </div>
        <textarea placeholder="Mensagem" />
        <button type="button" className="rating-button">Avaliar</button>
      </form>
    );
  }
}

export default Rating;
